    geo_json_c3cc0e0e3db5fb36f1103676ec331e51.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["Rettighetshaver", "Rettighetsnavn", "Rettighetstype", "Organisasjonsnummer", "Status", "Mineral", "Kommunenavn", "AvgK_ppm_str", "MaxK_ppm_str"];
    let aliases = ["Owner", "Name", "Type", "Organisation number", "Status", "Minerals", "Municipality", "Average Potassium ppm", "Max Potassium ppm"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
    ,{
  "sticky": false,
  "className": "foliumtooltip",
});
